
File References:
- Podfile
- Frameworks:
  - iOS:
    - Foundation.framework
- Pods:
  - Test:
    - AFRaptureXMLRequestOperation.h
    - AFRaptureXMLRequestOperation.m
    - Foo:
      - Foo.h
      - Foo.m
    - Support Files:
      - Pods-Test.xcconfig
      - Pods-Test-Private.xcconfig
      - Pods-Test-dummy.m
      - Pods-Test-prefix.pch
- Products:
  - libPods.a
  - libPods-Test.a
- Targets Support Files:
  - Pods:
    - Pods-acknowledgements.markdown
    - Pods-acknowledgements.plist
    - Pods-dummy.m
    - Pods-environment.h
    - Pods-resources.sh
    - Pods.debug.xcconfig
    - Pods.release.xcconfig



Targets:
- Pods:
    Build Phases:
    - SourcesBuildPhase:
      - Pods-dummy.m
    - FrameworksBuildPhase:
      - Foundation.framework
    Build Configurations:
    - Debug:
        Build Settings:
          ALWAYS_SEARCH_USER_PATHS: 'NO'
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          COPY_PHASE_STRIP: 'NO'
          DSTROOT: "/tmp/xcodeproj.dst"
          GCC_DYNAMIC_NO_PIC: 'NO'
          GCC_OPTIMIZATION_LEVEL: '0'
          GCC_PRECOMPILE_PREFIX_HEADER: 'YES'
          GCC_PREPROCESSOR_DEFINITIONS:
          - DEBUG=1
          - "$(inherited)"
          GCC_SYMBOLS_PRIVATE_EXTERN: 'NO'
          INSTALL_PATH: "$(BUILT_PRODUCTS_DIR)"
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          OTHER_LDFLAGS: ''
          PRODUCT_NAME: "$(TARGET_NAME)"
          PUBLIC_HEADERS_FOLDER_PATH: "$(TARGET_NAME)"
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
        Base Configuration: Pods.debug.xcconfig
    - Release:
        Build Settings:
          ALWAYS_SEARCH_USER_PATHS: 'NO'
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          COPY_PHASE_STRIP: 'YES'
          DSTROOT: "/tmp/xcodeproj.dst"
          GCC_PRECOMPILE_PREFIX_HEADER: 'YES'
          INSTALL_PATH: "$(BUILT_PRODUCTS_DIR)"
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          OTHER_CFLAGS:
          - "-DNS_BLOCK_ASSERTIONS=1"
          - "$(inherited)"
          OTHER_CPLUSPLUSFLAGS:
          - "-DNS_BLOCK_ASSERTIONS=1"
          - "$(inherited)"
          OTHER_LDFLAGS: ''
          PRODUCT_NAME: "$(TARGET_NAME)"
          PUBLIC_HEADERS_FOLDER_PATH: "$(TARGET_NAME)"
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          VALIDATE_PRODUCT: 'YES'
        Base Configuration: Pods.release.xcconfig
- Pods-Test:
    Build Phases:
    - SourcesBuildPhase:
      - AFRaptureXMLRequestOperation.m:
          COMPILER_FLAGS: "-fobjc-arc -DOS_OBJECT_USE_OBJC=0"
      - Foo.m:
          COMPILER_FLAGS: "-fobjc-arc -DOS_OBJECT_USE_OBJC=0"
      - Pods-Test-dummy.m
    - FrameworksBuildPhase:
      - Foundation.framework
    - HeadersBuildPhase:
      - AFRaptureXMLRequestOperation.h
      - Foo.h
    Build Configurations:
    - Debug:
        Build Settings:
          ALWAYS_SEARCH_USER_PATHS: 'NO'
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          COPY_PHASE_STRIP: 'NO'
          DSTROOT: "/tmp/xcodeproj.dst"
          GCC_DYNAMIC_NO_PIC: 'NO'
          GCC_OPTIMIZATION_LEVEL: '0'
          GCC_PRECOMPILE_PREFIX_HEADER: 'YES'
          GCC_PREFIX_HEADER: Pods-Test-prefix.pch
          GCC_PREPROCESSOR_DEFINITIONS:
          - DEBUG=1
          - "$(inherited)"
          GCC_SYMBOLS_PRIVATE_EXTERN: 'NO'
          INSTALL_PATH: "$(BUILT_PRODUCTS_DIR)"
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          OTHER_LDFLAGS: ''
          PRODUCT_NAME: "$(TARGET_NAME)"
          PUBLIC_HEADERS_FOLDER_PATH: "$(TARGET_NAME)"
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
        Base Configuration: Pods-Test-Private.xcconfig
    - Release:
        Build Settings:
          ALWAYS_SEARCH_USER_PATHS: 'NO'
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          COPY_PHASE_STRIP: 'YES'
          DSTROOT: "/tmp/xcodeproj.dst"
          GCC_PRECOMPILE_PREFIX_HEADER: 'YES'
          GCC_PREFIX_HEADER: Pods-Test-prefix.pch
          INSTALL_PATH: "$(BUILT_PRODUCTS_DIR)"
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          OTHER_CFLAGS:
          - "-DNS_BLOCK_ASSERTIONS=1"
          - "$(inherited)"
          OTHER_CPLUSPLUSFLAGS:
          - "-DNS_BLOCK_ASSERTIONS=1"
          - "$(inherited)"
          OTHER_LDFLAGS: ''
          PRODUCT_NAME: "$(TARGET_NAME)"
          PUBLIC_HEADERS_FOLDER_PATH: "$(TARGET_NAME)"
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          VALIDATE_PRODUCT: 'YES'
        Base Configuration: Pods-Test-Private.xcconfig



Build Configurations:
- Debug:
    Build Settings:
      ALWAYS_SEARCH_USER_PATHS: 'NO'
      CLANG_CXX_LANGUAGE_STANDARD: gnu++0x
      CLANG_CXX_LIBRARY: libc++
      CLANG_ENABLE_MODULES: 'YES'
      CLANG_ENABLE_OBJC_ARC: 'NO'
      CLANG_WARN_BOOL_CONVERSION: 'YES'
      CLANG_WARN_CONSTANT_CONVERSION: 'YES'
      CLANG_WARN_DIRECT_OBJC_ISA_USAGE: 'YES'
      CLANG_WARN_EMPTY_BODY: 'YES'
      CLANG_WARN_ENUM_CONVERSION: 'YES'
      CLANG_WARN_INT_CONVERSION: 'YES'
      CLANG_WARN_OBJC_ROOT_CLASS: 'YES'
      COPY_PHASE_STRIP: 'YES'
      GCC_C_LANGUAGE_STANDARD: gnu99
      GCC_DYNAMIC_NO_PIC: 'NO'
      GCC_OPTIMIZATION_LEVEL: '0'
      GCC_PREPROCESSOR_DEFINITIONS:
      - DEBUG=1
      - "$(inherited)"
      GCC_SYMBOLS_PRIVATE_EXTERN: 'NO'
      GCC_WARN_64_TO_32_BIT_CONVERSION: 'YES'
      GCC_WARN_ABOUT_RETURN_TYPE: 'YES'
      GCC_WARN_UNDECLARED_SELECTOR: 'YES'
      GCC_WARN_UNINITIALIZED_AUTOS: 'YES'
      GCC_WARN_UNUSED_FUNCTION: 'YES'
      GCC_WARN_UNUSED_VARIABLE: 'YES'
      IPHONEOS_DEPLOYMENT_TARGET: '6.0'
      ONLY_ACTIVE_ARCH: 'YES'
      STRIP_INSTALLED_PRODUCT: 'NO'
- Release:
    Build Settings:
      ALWAYS_SEARCH_USER_PATHS: 'NO'
      CLANG_CXX_LANGUAGE_STANDARD: gnu++0x
      CLANG_CXX_LIBRARY: libc++
      CLANG_ENABLE_MODULES: 'YES'
      CLANG_ENABLE_OBJC_ARC: 'NO'
      CLANG_WARN_BOOL_CONVERSION: 'YES'
      CLANG_WARN_CONSTANT_CONVERSION: 'YES'
      CLANG_WARN_DIRECT_OBJC_ISA_USAGE: 'YES'
      CLANG_WARN_EMPTY_BODY: 'YES'
      CLANG_WARN_ENUM_CONVERSION: 'YES'
      CLANG_WARN_INT_CONVERSION: 'YES'
      CLANG_WARN_OBJC_ROOT_CLASS: 'YES'
      COPY_PHASE_STRIP: 'NO'
      ENABLE_NS_ASSERTIONS: 'NO'
      GCC_C_LANGUAGE_STANDARD: gnu99
      GCC_PREPROCESSOR_DEFINITIONS:
      - RELEASE=1
      GCC_WARN_64_TO_32_BIT_CONVERSION: 'YES'
      GCC_WARN_ABOUT_RETURN_TYPE: 'YES'
      GCC_WARN_UNDECLARED_SELECTOR: 'YES'
      GCC_WARN_UNINITIALIZED_AUTOS: 'YES'
      GCC_WARN_UNUSED_FUNCTION: 'YES'
      GCC_WARN_UNUSED_VARIABLE: 'YES'
      IPHONEOS_DEPLOYMENT_TARGET: '6.0'
      STRIP_INSTALLED_PRODUCT: 'NO'
      VALIDATE_PRODUCT: 'YES'
